preload.script:
function validateAllInput(input, isRequired = true, minLength = null, maxLength = null, regex = null, errorMessage = null) {
  const locale = window.localStorage.getItem("locale");

  if (isRequired) {
    if (input === null || input === undefined || input.trim() === "") {
      return locale === "en" ? `Required field` : `Trường này là bắt buộc`;
    }
  }

  // Nếu không bắt buộc mà input rỗng thì bỏ qua mấy cái check dưới
  if (!isRequired && (input === null || input === undefined || input.trim() === "")) {
    return "";
  }

  if (minLength !== null && input.length < minLength) {
    return locale === "en" 
      ? `At least ${minLength} characters are required` 
      : `Phải nhập tối thiểu ${minLength} ký tự`;
  }

  if (maxLength !== null && input.length > maxLength) {
    return locale === "en" 
      ? `Only up to ${maxLength} characters are allowed` 
      : `Chỉ được phép nhập tối đa ${maxLength} ký tự`;
  }

  // Chỉ check regex khi input có giá trị
  if (regex !== null && input.trim() !== "" && !new RegExp(regex).test(input)) {
    return errorMessage ?? (locale === "en" ? `Error format` : `Lỗi định dạng`);
  }

  return "";
}

function validateInputDate(fromDate,toDate) {
  if (fromDate == null ) {
    return "Thông tin tìm kiếm bắt buộc nhập";
}
  if(fromDate > toDate){
    return "Từ ngày không được lớn hơn Đến ngày";
  }
  return "";
}

